import React, { useState, useEffect, useCallback } from 'react';
import { motion } from 'framer-motion';
import { 
  UserCheck, 
  Phone, 
  Mail, 
  MapPin, 
  Award,
  Edit,
  Trash2,
  Plus,
  Search,
  Filter,
  Star,
  Briefcase
} from 'lucide-react';

interface WorkingHours {
  day: string;
  start_time: string;
  end_time: string;
  is_available: boolean;
}

interface Doctor {
  id: string;
  doctor_id: string;
  first_name: string;
  last_name: string;
  title: string;
  specialty: string;
  department?: string;
  email?: string;
  phone?: string;
  office_location?: string;
  education?: string[];
  certifications?: string[];
  years_experience?: number;
  languages?: string[];
  bio?: string;
  consultation_fee?: number;
  working_hours?: WorkingHours[];
  is_available: boolean;
  is_active: boolean;
  rating?: number;
  total_reviews: number;
  created_at: string;
  updated_at: string;
}

interface DoctorsListProps {
  onDoctorSelect?: (doctor: Doctor) => void;
  onEdit?: (doctor: Doctor) => void;
  onCreateNew?: () => void;
}

const DoctorsList: React.FC<DoctorsListProps> = ({ 
  onDoctorSelect,
  onEdit,
  onCreateNew 
}) => {
  const [doctors, setDoctors] = useState<Doctor[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [searchQuery, setSearchQuery] = useState('');
  const [filters, setFilters] = useState({
    specialty: '',
    department: '',
    min_experience: '',
    is_available: '',
    is_active: true
  });
  const [selectedDoctor, setSelectedDoctor] = useState<Doctor | null>(null);
  const [showFilters, setShowFilters] = useState(false);

  useEffect(() => {
    fetchDoctors();
  }, [searchQuery, filters]);

  const fetchDoctors = async () => {
    try {
      setLoading(true);
      setError(null);

      const params = new URLSearchParams();
      if (searchQuery) params.append('q', searchQuery);
      if (filters.specialty) params.append('specialty', filters.specialty);
      if (filters.department) params.append('department', filters.department);
      if (filters.min_experience) params.append('min_experience', filters.min_experience);
      if (filters.is_available !== '') params.append('is_available', filters.is_available);
      if (filters.is_active !== undefined) params.append('is_active', filters.is_active.toString());

      const endpoint = searchQuery || Object.values(filters).some(f => f !== '' && f !== true) 
        ? `/api/doctors/search/?${params.toString()}`
        : '/api/doctors/';

      const response = await fetch(endpoint);
      if (!response.ok) throw new Error('Failed to fetch doctors');

      const data = await response.json();
      setDoctors(data);
    } catch (err) {
      console.error('Error fetching doctors:', err);
      setError('Failed to load doctors');
    } finally {
      setLoading(false);
    }
  };

  const handleDeactivate = async (doctorId: string) => {
    if (!confirm('Are you sure you want to deactivate this doctor?')) return;

    try {
      const response = await fetch(`/api/doctors/${doctorId}`, {
        method: 'DELETE'
      });

      if (!response.ok) throw new Error('Failed to deactivate doctor');

      await fetchDoctors(); // Refresh list
    } catch (err) {
      console.error('Error deactivating doctor:', err);
      alert('Failed to deactivate doctor');
    }
  };

  const getAvailabilityStatus = (doctor: Doctor): string => {
    if (!doctor.is_active) return 'Inactive';
    if (!doctor.is_available) return 'Unavailable';
    
    const today = new Date().toLocaleString('en-US', { weekday: 'long' });
    const todaySchedule = doctor.working_hours?.find(
      wh => wh.day.toLowerCase() === today.toLowerCase()
    );
    
    if (!todaySchedule || !todaySchedule.is_available) return 'Off Today';
    return 'Available';
  };

  const getStatusColor = (status: string): string => {
    switch (status) {
      case 'Available': return 'bg-green-100 text-green-800';
      case 'Off Today': return 'bg-yellow-100 text-yellow-800';
      case 'Unavailable': return 'bg-orange-100 text-orange-800';
      case 'Inactive': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  const DoctorCard: React.FC<{ doctor: Doctor }> = ({ doctor }) => {
    const status = getAvailabilityStatus(doctor);
    
    return (
      <motion.div
        layout
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        exit={{ opacity: 0, y: -20 }}
        className="card hover:shadow-lg transition-shadow cursor-pointer"
        onClick={() => {
          setSelectedDoctor(doctor);
          onDoctorSelect?.(doctor);
        }}
      >
        <div className="flex justify-between items-start mb-4">
          <div className="flex items-center space-x-3">
            <div className="bg-gradient-to-r from-green-500 to-emerald-500 p-3 rounded-full">
              <UserCheck className="w-6 h-6 text-white" />
            </div>
            <div>
              <h3 className="text-lg font-semibold text-gray-900">
                {doctor.title} {doctor.first_name} {doctor.last_name}
              </h3>
              <p className="text-sm text-gray-500">ID: {doctor.doctor_id}</p>
              <p className="text-sm font-medium text-blue-600">{doctor.specialty}</p>
            </div>
          </div>
          
          <div className="flex items-center space-x-2">
            <span className={`px-2 py-1 rounded-full text-xs font-medium ${getStatusColor(status)}`}>
              {status}
            </span>
            
            <div className="flex space-x-1">
              <motion.button
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
                onClick={(e) => {
                  e.stopPropagation();
                  onEdit?.(doctor);
                }}
                className="p-2 text-blue-600 hover:bg-blue-50 rounded-lg"
              >
                <Edit className="w-4 h-4" />
              </motion.button>
              <motion.button
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
                onClick={(e) => {
                  e.stopPropagation();
                  handleDeactivate(doctor.id);
                }}
                className="p-2 text-red-600 hover:bg-red-50 rounded-lg"
              >
                <Trash2 className="w-4 h-4" />
              </motion.button>
            </div>
          </div>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-3 text-sm mb-4">
          {doctor.department && (
            <div className="flex items-center space-x-2 text-gray-600">
              <Briefcase className="w-4 h-4" />
              <span>{doctor.department}</span>
            </div>
          )}
          {doctor.phone && (
            <div className="flex items-center space-x-2 text-gray-600">
              <Phone className="w-4 h-4" />
              <span>{doctor.phone}</span>
            </div>
          )}
          {doctor.email && (
            <div className="flex items-center space-x-2 text-gray-600">
              <Mail className="w-4 h-4" />
              <span>{doctor.email}</span>
            </div>
          )}
          {doctor.office_location && (
            <div className="flex items-center space-x-2 text-gray-600">
              <MapPin className="w-4 h-4" />
              <span>{doctor.office_location}</span>
            </div>
          )}
          {doctor.years_experience && (
            <div className="flex items-center space-x-2 text-gray-600">
              <Award className="w-4 h-4" />
              <span>{doctor.years_experience} years experience</span>
            </div>
          )}
          {doctor.consultation_fee && (
            <div className="flex items-center space-x-2 text-gray-600">
              <span className="text-green-600 font-semibold">${doctor.consultation_fee}</span>
            </div>
          )}
        </div>

        {doctor.rating && doctor.total_reviews > 0 && (
          <div className="flex items-center space-x-2 mb-3">
            <div className="flex items-center">
              {[...Array(5)].map((_, i) => (
                <Star 
                  key={i} 
                  className={`w-4 h-4 ${i < Math.floor(doctor.rating!) ? 'text-yellow-400 fill-current' : 'text-gray-300'}`} 
                />
              ))}
            </div>
            <span className="text-sm text-gray-600">
              {doctor.rating.toFixed(1)} ({doctor.total_reviews} reviews)
            </span>
          </div>
        )}

        {doctor.languages && doctor.languages.length > 0 && (
          <div className="mb-3">
            <span className="text-xs font-medium text-gray-700">Languages:</span>
            <div className="flex flex-wrap gap-1 mt-1">
              {doctor.languages.map((language, index) => (
                <span key={index} className="bg-blue-50 text-blue-700 text-xs px-2 py-1 rounded">
                  {language}
                </span>
              ))}
            </div>
          </div>
        )}

        {doctor.certifications && doctor.certifications.length > 0 && (
          <div className="mb-3">
            <span className="text-xs font-medium text-gray-700">Certifications:</span>
            <div className="flex flex-wrap gap-1 mt-1">
              {doctor.certifications.slice(0, 3).map((cert, index) => (
                <span key={index} className="bg-green-50 text-green-700 text-xs px-2 py-1 rounded">
                  {cert}
                </span>
              ))}
              {doctor.certifications.length > 3 && (
                <span className="text-xs text-gray-500">+{doctor.certifications.length - 3} more</span>
              )}
            </div>
          </div>
        )}

        {doctor.bio && (
          <div className="mt-3 pt-3 border-t border-gray-100">
            <p className="text-sm text-gray-600 line-clamp-2">{doctor.bio}</p>
          </div>
        )}
      </motion.div>
    );
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-green-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex flex-col sm:flex-row justify-between items-start sm:items-center gap-4">
        <div className="flex items-center space-x-3">
          <div className="bg-green-100 p-2 rounded-lg">
            <UserCheck className="w-6 h-6 text-green-600" />
          </div>
          <div>
            <h1 className="text-2xl font-bold text-gray-900">Doctors</h1>
            <p className="text-gray-600">{doctors.length} doctors found</p>
          </div>
        </div>
        
        <div className="flex space-x-3">
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            onClick={() => setShowFilters(!showFilters)}
            className="btn-secondary flex items-center space-x-2"
          >
            <Filter className="w-4 h-4" />
            <span>Filters</span>
          </motion.button>
          
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            onClick={onCreateNew}
            className="btn-primary flex items-center space-x-2"
          >
            <Plus className="w-4 h-4" />
            <span>New Doctor</span>
          </motion.button>
        </div>
      </div>

      {/* Search and Filters */}
      <div className="space-y-4">
        <div className="relative">
          <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-5 h-5" />
          <input
            type="text"
            placeholder="Search doctors by name, specialty, or department..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            className="w-full pl-10 pr-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-transparent"
          />
        </div>

        {showFilters && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="card bg-gray-50"
          >
            <h3 className="font-medium text-gray-900 mb-3">Filters</h3>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-5 gap-4">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Specialty</label>
                <input
                  type="text"
                  value={filters.specialty}
                  onChange={(e) => setFilters({...filters, specialty: e.target.value})}
                  placeholder="Enter specialty"
                  className="w-full p-2 border border-gray-300 rounded-lg"
                />
              </div>
              
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Department</label>
                <input
                  type="text"
                  value={filters.department}
                  onChange={(e) => setFilters({...filters, department: e.target.value})}
                  placeholder="Enter department"
                  className="w-full p-2 border border-gray-300 rounded-lg"
                />
              </div>
              
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Min Experience</label>
                <input
                  type="number"
                  value={filters.min_experience}
                  onChange={(e) => setFilters({...filters, min_experience: e.target.value})}
                  placeholder="Years"
                  className="w-full p-2 border border-gray-300 rounded-lg"
                />
              </div>
              
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Availability</label>
                <select
                  value={filters.is_available}
                  onChange={(e) => setFilters({...filters, is_available: e.target.value})}
                  className="w-full p-2 border border-gray-300 rounded-lg"
                >
                  <option value="">All</option>
                  <option value="true">Available</option>
                  <option value="false">Unavailable</option>
                </select>
              </div>
              
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">Status</label>
                <select
                  value={filters.is_active.toString()}
                  onChange={(e) => setFilters({...filters, is_active: e.target.value === 'true'})}
                  className="w-full p-2 border border-gray-300 rounded-lg"
                >
                  <option value="true">Active Only</option>
                  <option value="false">Inactive Only</option>
                </select>
              </div>
            </div>
          </motion.div>
        )}
      </div>

      {/* Error State */}
      {error && (
        <div className="text-center py-12">
          <p className="text-red-600 mb-4">{error}</p>
          <button onClick={fetchDoctors} className="btn-primary">
            Retry
          </button>
        </div>
      )}

      {/* Results */}
      {!loading && !error && (
        <>
          {doctors.length === 0 ? (
            <div className="text-center py-12">
              <UserCheck className="w-16 h-16 text-gray-300 mx-auto mb-4" />
              <h3 className="text-lg font-medium text-gray-900 mb-2">No doctors found</h3>
              <p className="text-gray-600 mb-4">Try adjusting your search or filters</p>
              <button onClick={onCreateNew} className="btn-primary">
                Add New Doctor
              </button>
            </div>
          ) : (
            <div className="grid grid-cols-1 lg:grid-cols-2 xl:grid-cols-3 gap-6">
              {doctors.map((doctor) => (
                <DoctorCard key={doctor.id} doctor={doctor} />
              ))}
            </div>
          )}
        </>
      )}
    </div>
  );
};

export default DoctorsList;
